  false,\n\t\"url\": null,\n\t\"notes\": \"High-resolution measurements of waves,
  currents, water levels, temperature, salinity and turbidity were made in Hanalei
  Bay, Kauai, Hawaii during the summer of 2006. A series of bottom-mounted instrument
  packages were deployed in water depths of 10 m or less. These data support the ongoing
  process studies being conducted as part of the US Geological Survey Coastal and
  Marine Geology Program's Pacific Coral Project. Finalized data were provided in
  ASCII format for the waves, currents, and water levels. Other variables are summarized
  in graphics and described in a technical report.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
